package jan19;

public class Continuekeyword {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=10;i++)
		{
		
			
			if(i==5)
			{
				continue;// skip any no then use  this keyword
			}
			System.out.println(i);
		}
		
		System.out.println("outside for loop");

	}
	}

	

	
